import React, { useEffect } from "react";
import {
  AppBar,
  Container,
  Toolbar,
  Typography,
  IconButton,
  Box,
  useTheme,
  Button,
  Avatar,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import { Link, useLocation, useNavigate, useParams } from "react-router-dom";
import Brightness7Icon from "@mui/icons-material/Brightness7";
import Brightness4Icon from "@mui/icons-material/Brightness4";
import { conditions } from "./ReduxServices/Slices/conditions-slice";
import LogoutIcon from "@mui/icons-material/Logout";
// import { useDispatch, useSelector } from "react-redux";
import { userFetch } from "./ReduxServices/Slices/user-slice";

export default function AppBarR(props) {
  const pages = ["Home", "Sign In", "sign Up"];
  const pagesHref = ["/", "/signin", "/signup"];
  const location = useLocation();
  const theme = useTheme();
//   const dispatch = useDispatch();
  const logInPages = ["Home", "New Post", "Settings"];
//   const conditionsPage = useSelector((state) => state.condition);
//   const user = JSON.parse(localStorage.getItem("user-info"));
//   const image = user ? `http://localhost:3000/${user.image}` : null;
  const logInPagesHref = ["/", "/newPost", `/settings`  ];
  const navigate = useNavigate();
//   const userRedux = useSelector((state) => state.user);

//   useEffect(() => {
//     const user = JSON.parse(localStorage.getItem("user-info"));
//     if (user) {
//       dispatch(conditions(true));
//     }
//   }, []);

//   useEffect(() => {
//     dispatch(userFetch());
//   }, []);

  return (
    <AppBar
      position="static"
      sx={{ backgroundColor: "transparent", boxShadow: "none" }}
    >
      <Container>
        <Toolbar disableGutters>
          <IconButton
            aria-label=""
            sx={{ display: { xs: "flex", md: "none" } }}
            onClick={() => {
              props.openToggle();
              localStorage.setItem("current value", props.mode);
            }}
          >
            <MenuIcon />
          </IconButton>
          <Box sx={{ flexGrow: 1 }}>
            <Link
              to="/"
              style={{
                color: "#5CB85C",
                textDecoration: "none",
                fontSize: "25px",
              }}
            >
              Conduit
            </Link>
          </Box>
          <Box
            sx={{
              display: { xs: "none", md: "flex" },
              justifyContent: "center",
              alignItems: "center",
              flexDirection: "row",
            }}
          >



            {conditionsPage
              ? 
              logInPages.map((page, index) => (
                  <Link
                    to={logInPagesHref[index]}
                    style={{
                      textDecoration: "none",
                      color: theme.palette.white.main,
                      backgroundColor:
                        location.pathname === logInPagesHref[index]
                          ? theme.palette.mainColor.main
                          : "",
                    }}
                    key={page}
                  >
                    <Typography
                      className="btn"
                      component={"h2"}
                      variant="h6"
                      sx={{
                        fontSize: "16px",
                        p: "10px",
                        color: theme.palette.white.main,
                      }}
                    >
                      {page}
                    </Typography>
                  </Link>
                ))
              : 
              pages.map((page, index) => (
                  <Link
                    to={pagesHref[index]}
                    style={{
                      textDecoration: "none",
                      color: theme.palette.white.main,
                      backgroundColor:
                        location.pathname === pagesHref[index]
                          ? theme.palette.mainColor.main
                          : "",
                    }}
                    key={page}
                  >
                    <Typography
                      className="btn"
                      component={"h2"}
                      variant="h6"
                      sx={{
                        fontSize: "16px",
                        p: "10px",
                        color: theme.palette.white.main,
                      }}
                    >
                      {page}
                    </Typography>
                  </Link>
                ))}

            {/* {conditionsPage ? (
              <>
                
                  <Link to={`/profile`} key={user.username}>
                    <Avatar src={image} alt="user picture" />
                  </Link>
                <IconButton
                  onClick={() => {
                    dispatch(conditions(false));
                    console.log("condition set to false");
                    localStorage.removeItem("user-info");
                    localStorage.removeItem("condition");
                    navigate("/");
                  }}
                >
                  <LogoutIcon />
                </IconButton>
              </>
            ) : (
              ""
            )} */}
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}
